import React from "react";
import PropTypes from 'prop-types';
import { styled } from '@mui/material/styles';
import Dialog from '@mui/material/Dialog';
import DialogTitle from '@mui/material/DialogTitle';
import DialogContent from '@mui/material/DialogContent';
import IconButton from '@mui/material/IconButton';
import CloseIcon from '@mui/icons-material/Close';
import Paper from '@mui/material/Paper';
import Box from '@mui/material/Box';
import Grid from '@mui/material/Grid';
import { Link } from 'react-router-dom';


const BootstrapDialog = styled(Dialog)(({ theme }) => ({
  '& .MuiDialogContent-root': {
    padding: theme.spacing(2),

  },
  '& .MuiDialogActions-root': {
    padding: theme.spacing(1),

  },
}));

const Item = styled(Paper)(({ theme }) => ({
  ...theme.typography.body2,
  padding: theme.spacing(2),
  textAlign: 'center',
  color: theme.palette.text.secondary,
}));

const BootstrapDialogTitle = (props) => {
  const { children, onClose, ...other } = props;

  return (
    <DialogTitle sx={{ m: 0, p: 2 }} {...other}>
      {children}
      {onClose ? (
        <IconButton
          aria-label="close"
          onClick={onClose}
          sx={{
            position: 'absolute',
            right: 8,
            top: 8,
            color: (theme) => theme.palette.grey[500],
          }}
        >
          <CloseIcon />
        </IconButton>
      ) : null}
    </DialogTitle>
  );
};

BootstrapDialogTitle.propTypes = {
  children: PropTypes.node,
  onClose: PropTypes.func.isRequired,
};

export default function PopoverCompanies({ companies, handleClickButton }) {

  return (
    <div className="modal fade" id="exampleModalCenter" tabIndex="-1" role="dialog" aria-labelledby="exampleModalCenterTitle" aria-hidden="true">
      <div className="modal-dialog modal-dialog-centered" role="document">
        <div className="modal-content">
          <div className="modal-header">
            <h5 className="modal-title" id="exampleModalLongTitle">All companies</h5>
            <button type="button" className="close" data-dismiss="modal" aria-label="Close">
              <span aria-hidden="true">&times;</span>
            </button>
          </div>
          <div className="modal-body">
            <div class="c-container"></div>
            {companies && companies.companies_list ?
              companies.companies_list.map(value => (
                <button
                  className="btn btn-secondary mr-2"
                  type="button"
                  onClick={handleClickButton}
                  value={value}
                  key={value}
                  style={{ width: 150 }}
                  >
                  {value}
                </button>
              )) : null
            }
          </div>
        </div>
      </div>
    </div>
    // <div style={{maxWidth: 2000}}>
    //   <BootstrapDialog
    //     onClose={handleClose}
    //     aria-labelledby="customized-dialog-title"
    //     open={open}


    //   >
    //     <BootstrapDialogTitle className="text-center" onClose={handleClose}>
    //       All Companies
    //     </BootstrapDialogTitle>
    //     <DialogContent dividers>
    //       <Box style={{ width: 650, margin: "auto" }} className="mt-5">
    //         <Grid container spacing={{ xs: 2, md: 3 }} columns={{ xs: 4, sm: 8, md: 16 }}>
    //           {companies.companies_list.map(value => (
    //             <Grid item xs={2} sm={4} md={4} key={value}>
    //               <Item
    //                 type="button"
    //                 id={value}
    //               >{value}
    //               </Item>
    //             </Grid>
    //           ))}
    //         </Grid>
    //       </Box>
    //     </DialogContent>
    //   </BootstrapDialog>
    // </div>
  );
}
